/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring_slow = function(s) {
    let tmp = '';
    let length = 0;
    let subStr = '';
    let k;
    const set = new Set();
    if (s.length === 0) {
        return 0;
    }
    if (s.length === 1) {
        return 1;
    }
    for (let i = 0; i <= s.length; i++) {
        for (let j = i + 1 ; j <= s.length; j++) {
            subStr = s.substring(i,j);
            const subStrLen = subStr.length;
            set.clear();
            for (k = 0; k < subStrLen; k++) {
                const char = subStr.charAt(k)
                if (set.has(char)) {
                    break;
                } else {
                    set.add(char);
                }
            }
            if (k === subStrLen && subStrLen > length) {
                length = subStrLen;
            }
        }
    }
    return length;
};

/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function(s) {
    const map = new Map();
    let char = '';
    let maxLength = 0;
    let i = 0;
    for (let j = 0; j < s.length; j++) {
        char = s[j];
        if (map.get(char) !== undefined) {
            i = Math.max(i, map.get(char) + 1);
        }
        map.set(char, j);
        maxLength = Math.max(maxLength, j - i + 1)

    }
    return maxLength;
}

